import React, { Component } from 'react';

import './index.scss'

export default class index extends Component {
    render() {
        return (
            <div className="hpoi-container">
                <div className="box-title">
                    <ul className="hpoi-switch-header">
                        <li className="hpoi-switcher-header-item">全部</li>
                        <li className="hpoi-switcher-header-item">制作</li>
                        <li className="hpoi-switcher-header-item">更图</li>
                        <li className="hpoi-switcher-header-item">开订</li>
                        <li className="hpoi-switcher-header-item">延期</li>
                        <li className="hpoi-switcher-header-item">出荷</li>
                        <li className="hpoi-switcher-header-item">再版</li>
                        <li className="hpoi-switcher-header-anchor"></li>
                    </ul>
                </div>
            </div>
        )
    }
}
